import React from 'react';
import ReactDOM from 'react-dom';



// createUnorderedList function
function createUnorderedList(list) {
  return React.createUnorderedList(
    'ul',
    list.map((item, index) =>
      React.createElement('li', { key: index }, item)
    )
  );
}

// Example usages of the functions
const helloWorldDiv = createElement('Hello World');
const customTag = createElement('Hello World', 'h1', { className: 'greeting' });
const fruits = createUnorderedList(['apples', 'oranges', 'bananas']);

// Render the elements to the DOM
export default function App(){
  return(
<div>
    {helloWorldDiv}
    {customTag}
    {fruits}
  </div>
  )
}



